import Link from 'next/link';

const Menu = () => {
    return (
        <div>
            <Link href="/">
                <a>Home</a>
            </Link>
            <Link href="/">
                <a>About</a>
            </Link>
            <Link href="/">
                <a></a>
            </Link>
        </div>
    );
}
export default Menu;
